// ticker stickers that have been created
var tickerStickersCreated = {};

// regex for splitting text nodes
var TEXT_REGEX = /[^aA-zZ]+|[aA-zZ]+/g;

window.addEventListener('load', function() {
	// make sure that extension is on
	chrome.storage.sync.get('state', function(result) {
		if(result.state == '1') {
			console.log("stickerfying...");
			stickerfyPage();
		}
	});
});

// checks if the given ticker is contained in the ticker trie (case-sensitive)
function isTicker(ticker) {
	var currNode = tickerTrie;
	for (var i=0; i<ticker.length; i++) {
		var letter = ticker.charAt(i);
		if (currNode[letter] === undefined) {
			return false;
		}
		currNode = currNode[letter];
	}
	return currNode[''] === '';
}


function stickerfyPage() {
	// search through DOM for text nodes
	var walk = document.createTreeWalker(
		document.body,
		NodeFilter.SHOW_TEXT,
		{
			acceptNode: function(node) {
				if (node.parentNode.nodeName == 'SCRIPT' || node.parentNode.nodeName == 'STYLE' || node.parentNode.nodeName == 'A' || node.parentNode.nodeName == 'NOSCRIPT') {
					return NodeFilter.FILTER_REJECT;
				}
				return NodeFilter.FILTER_ACCEPT;
			}
		},
		false);

	while(walk.nextNode()) {
		var currTextNode = walk.currentNode;
		var currTextNodeParent = currTextNode.parentNode;
		var wordIndex = 0;

		// iterate through each word of the text node to look for stock tickers
		var nodeTextArr = currTextNode.textContent.match(TEXT_REGEX) || [];
		for(var i = 0; i < nodeTextArr.length; i++) {
			var scrubbedText = nodeTextArr[i];

			if (tickerStickersCreated.hasOwnProperty(scrubbedText) || isTicker(scrubbedText)) {
				var restCurrTextNode = currTextNode.splitText(wordIndex + nodeTextArr[i].length);	// textnode up until right after ticker
				var tickerTextNode = currTextNode.splitText(wordIndex);	// textnode up until right before ticker

				// make the new tickerSticker
				var tickerSticker;
				if (tickerStickersCreated[scrubbedText] === undefined) {
					tickerSticker = makeTickerSticker(scrubbedText);
				} else {
					tickerSticker = tickerStickersCreated[scrubbedText].cloneNode(true);
				}

				// replace the old text node
				try {
					currTextNodeParent.replaceChild(tickerSticker, tickerTextNode);
				} catch(err) {
					console.log(err);
				}

				currTextNode = restCurrTextNode;	// update textnode to reflect the next part of it
				wordIndex = 0;
				walk.nextNode();	// treewalker is dynamic so this accounts for the two newly created nodes
				walk.nextNode();
			} else {
				wordIndex += nodeTextArr[i].length;
			}
		}
	}
}


function makeTickerSticker(tickerName) {
	mouseoverCallback = function(stickerParent, quote) {
		var sticker = document.createElement("div");
		sticker.classList.add("sticker");
		var tickerhtml = "<div class='stickerContent'> <h1>{{Name}}<h1> <span>NYSE: {{Symbol}}</span> <br><br> <span><b>{{Open}}</b> USD {{Change}} ({{ChangeinPercent}})</span> <br> <table> <tr> <td>Open</td> <td>{{Open}}</td> <td>Mkt cap</td> <td>{{MarketCapitalization}}</td> </tr> <tr> <td>High</td> <td>{{DaysHigh}}</td> <td>P/E ratio</td> <td>{{PERatio}}</td> </tr> <tr> <td>Low</td> <td>{{DaysLow}}</td> <td>Div yield</td> <td>{{DividendYield}}</td> </tr> <tr> <td>Volume</td> <td>{{Volume}}</td> <td>EBITDA</td> <td>{{EBITDA}}</td> </tr> <tr> <td>EPS</td> <td>{{EarningsShare}}</td> <td>SIR</td> <td>{{ShortRatio}}</td> </tr> </table> </div>";
		sticker.innerHTML = Mustache.to_html(tickerhtml, quote);
		stickerParent.appendChild(sticker);
		tickerStickersCreated[tickerName] = stickerParent;
	}
	//var stickerHost = document.createElement('div');
	//var stickerRoot = stickerHost.createShadowRoot();
	var stickerParent = document.createElement('a');
	stickerParent.classList.add('stickerParent');
	stickerParent.setAttribute('href', '');
	stickerParent.textContent = tickerName;
	//stickerRoot.appendChild(stickerParent);
	// getting the ticker data on first hover
	$( stickerParent ).mouseover( function(event) {
		event.preventDefault();
		stickerHoverAction(event, tickerName, stickerParent, mouseoverCallback);
		// only need to do mouseover calculation once
		$( this ).unbind(event);
	});
	return stickerParent;
}

